import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import Header from '../components/layout/Header';
import Footer from '../components/layout/Footer';
import JobFilter from '../components/job/JobFilter';
import JobListItem from '../components/job/JobListItem';

// Mock data for jobs
const mockJobs = [
  {
    id: '1',
    title: 'Social Media Assistant',
    company: {
      name: 'Nomad',
      logo: '/company-logos/nomad.png',
      location: 'Paris, France'
    },
    type: 'Full Time',
    tags: ['Marketing', 'Design'],
    applicants: {
      count: 5,
      capacity: 10
    }
  },
  {
    id: '2',
    title: 'Brand Designer',
    company: {
      name: 'Dropbox',
      logo: '/company-logos/dropbox.png',
      location: 'San Francisco, USA'
    },
    type: 'Full Time',
    tags: ['Marketing', 'Design'],
    applicants: {
      count: 2,
      capacity: 10
    }
  },
  {
    id: '3',
    title: 'Interactive Developer',
    company: {
      name: 'Terraform',
      logo: '/company-logos/terraform.png',
      location: 'Hamburg, Germany'
    },
    type: 'Full Time',
    tags: ['Marketing', 'Design'],
    applicants: {
      count: 8,
      capacity: 12
    }
  },
  // Add more mock jobs here
];

const Jobs = () => {
  const [selectedFilters, setSelectedFilters] = useState<string[]>([]);
  const [sortBy, setSortBy] = useState('most-relevant');
  const [viewMode, setViewMode] = useState<'grid' | 'list'>('list');

  const handleFilterChange = (filter: string) => {
    setSelectedFilters(prev =>
      prev.includes(filter)
        ? prev.filter(f => f !== filter)
        : [...prev, filter]
    );
  };

  return (
    <div className="min-h-screen bg-gray-50">
      <Header />

      <main className="container mx-auto px-4 py-8">
        <div className="flex justify-between items-center mb-8">
          <h1 className="text-2xl font-bold">All Jobs</h1>
          <div className="flex items-center gap-4">
            <div className="flex items-center gap-2">
              <label htmlFor="sort" className="text-sm text-gray-600">Sort by:</label>
              <select
                id="sort"
                className="text-sm border border-gray-300 rounded-lg px-3 py-2"
                value={sortBy}
                onChange={(e) => setSortBy(e.target.value)}
              >
                <option value="most-relevant">Most relevant</option>
                <option value="newest">Newest</option>
                <option value="oldest">Oldest</option>
              </select>
            </div>
            <div className="flex items-center gap-2">
              <button
                className={`p-2 rounded-lg ${viewMode === 'grid' ? 'bg-gray-200' : 'hover:bg-gray-100'}`}
                onClick={() => setViewMode('grid')}
              >
                <svg className="w-5 h-5" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6a2 2 0 012-2h2a2 2 0 012 2v2a2 2 0 01-2 2H6a2 2 0 01-2-2V6zM14 6a2 2 0 012-2h2a2 2 0 012 2v2a2 2 0 01-2 2h-2a2 2 0 01-2-2V6zM4 16a2 2 0 012-2h2a2 2 0 012 2v2a2 2 0 01-2 2H6a2 2 0 01-2-2v-2zM14 16a2 2 0 012-2h2a2 2 0 012 2v2a2 2 0 01-2 2h-2a2 2 0 01-2-2v-2z" />
                </svg>
              </button>
              <button
                className={`p-2 rounded-lg ${viewMode === 'list' ? 'bg-gray-200' : 'hover:bg-gray-100'}`}
                onClick={() => setViewMode('list')}
              >
                <svg className="w-5 h-5" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16M4 18h16" />
                </svg>
              </button>
            </div>
          </div>
        </div>

        <div className="grid grid-cols-4 gap-8">
          {/* Filters */}
          <div className="col-span-1">
            <JobFilter
              selectedFilters={selectedFilters}
              onFilterChange={handleFilterChange}
            />
          </div>

          {/* Job List */}
          <div className="col-span-3 space-y-4">
            {mockJobs.map((job) => (
              <Link
                key={job.id}
                to={`/jobs/${job.id}`}
                className="block hover:shadow-lg transition-shadow"
              >
                <JobListItem {...job} />
              </Link>
            ))}
          </div>
        </div>
      </main>

      <Footer />
    </div>
  );
};

export default Jobs;
